const Posts = () => {
    const [postList, setPostList] = useState([])
    useEffect(() => {
       async function getListApi(){
           const url_API = 'http://js-post-api.herokuapp.com/api/posts?_limit=10&_page=1';
           const response = await fetch(url_API)
           const result = await response.json()
           console.log({result});
           const {data} = result;
           setPostList(data)
        }
        getListApi()
    }, [])
    return (
        <div>
            <Posts post={postList}></Posts>
        </div>
    )
}

export default Posts
